import React, { Component } from "react";
import StudentOfferList from "./StudentOfferList";
import OfferView from "./OfferView";
import NavBar from "../NavBar";
import { Link } from "react-router-dom";

class SearchOffer extends Component {

  Accueil = props => <Link to="/" {...props} />;
  Naturopathie = props => <Link to="/Naturopathie" {...props} />;
  Reflexologie = props => <Link to="/Reflexologie" {...props} />;
  render() {
    return (
      <div>
        <NavBar
          accueil={this.Accueil}
          naturopathie={this.Naturopathie}
          reflexologie={this.Reflexologie}
        />
        <h3>Page Trainee Search Offer</h3>
        <StudentOfferList />
        <OfferView />
      </div>
    );
  }
}

export default SearchOffer;
